(70, 1, '2022-08-01 07:16:38', '2022-08-01 07:16:38', 'เราให้บริการขนส่งสินค้าทางเรือที่ประหยัดต้นทุน. บริการเฉพาะนี้ผสานเครือข่ายการขนส่งสินค้าทั่วโลกของเราและความเชี่ยวชาญในท้องถิ่นเพื่อรับรองการขนส่งอะไหล่บนเรือในเวลาที่เหมาะสม. เราเลือกโหมดการขนส่งที่ดีที่สุดเพื่อให้ตรงกับข้อกังวลด้านเวลาและต้นทุนของลูกค้า และรับผิดชอบจนถึงการส่งมอบ.', 'บริการขนส่งสินค้าทางทะเล', '', 'publish', 'closed', 'closed', '', 'ocean-freight', '', '', '2022-08-04 10:35:16', '2022-08-04 10:35:16', '', 0, 'http://localhost:88/sevenstarsshipping.com/?p=70', 0, 'post', '', 0),
